INSERT INTO `tb_ontologia` VALUES (1,'Academic Institution Internal Structure Ontology','aiiso','http://purl.org/vocab/aiiso/schema','The Academic Institution Internal Structure Ontology (AIISO) provides classes and properties to describe the internal organizational structure of an academic institution. AIISO is designed to work in partnership with Participation (http://purl.org/vocab/participation/schema), FOAF (http://xmlns.com/foaf/0.1/) and aiiso-roles (http://purl.org/vocab/aiiso-roles/schema) to describe the roles that people play within an institution. [en]','2008-09-25 '),(2,'DCMI Metadata Terms','dc','http://purl.org/dc/terms','This document is an up-to-date specification of all metadata terms maintained by the Dublin Core Metadata Initiative, including properties, vocabulary encoding schemes, syntax encoding schemes, and classes.','2012-06-14'),(3,'Literal','literal','http://unb.br/literal','Metadados para auxiliar publicação de objetos literais','0.9 beta'),(4,'Estruturas Organizacionais Governamentais Brasileiras','siorg','http://vocab.e.gov.br/2011/09/org','Este documento é o resultado das discussões acerca do tema Estruturas Organizacionais Governamentais e o SIORG[1][3], abordados durante três reuniões, nos dias 8, 13 e 20 de setembro de 2011, entre participantes da Secretaria-Executiva (SE) e das Secretarias de Gestão (SEGES) e de Logística e Tecnologia da Informação (SLTI).','2011a'),(5,'Friend of a Friend','foaf','http://xmlns.com/foaf/0.1/','This specification describes the FOAF language, defined as a dictionary of named properties and classes using W3C\'s RDF technology.','0.1'),(6,'UnB Ontologia Temporaria','unb','http://dadosabertos.unb.br/ontologia','Ontologia temporaria','0.1'),(7,'Univ-bench Ontology','lubm','http://swat.cse.lehigh.edu/onto/univ-bench.owl','An university ontology for benchmark tests','univ-bench-ontology-owl, ver April 1, 2004');
